import 'bootstrap/dist/css/bootstrap.css';
import '../estilos-todos.css';

const Componente = () => {
    return (
        <div className='fondo'>
            <div className='App-header margenes'>
                <br></br>
                <h4>Estamos en Pilar pero hacemos entregas hasta Zona Oeste y Capital Federal</h4>
                {/* <iframe
                    title='location'
