                    width="600"
                    height="450"
                    allowFullScreen=""
                    loading="lazy"
                    referrerPolicy="no-referrer-when-downgrade" /> */}
            </div>
        </div>
    )
}

export const Ubicacion = () => {
    return (
        <div>
            <Componente />
        </div>
    )
}
